import
  std/strutils,
  stew/byteutils,
  ../kzg_abi

from os import DirSep

type
  KateBlobs* = object
    kates*: seq[KzgCommitment]
    blobs*: seq[KzgBlob]

const
  kzgPath* = currentSourcePath.rsplit(DirSep, 4)[0] & "/"
  trustedSetupFile* = kzgPath & "src/trusted_setup.txt"
  MAX_TOP_BYTE* = 114
  blob* = hexToByteArray[KzgBlobSize]("")
  proof* = hexToByteArray[48]("A5F3249AB541E79D94325F4D9B7812B66CE60B582519776DCB276EFE4B8212E298B66774063AC57A2FE0145F20973950")
  commitment* = hexToByteArray[48]("81C821BE43CFA03D0502D5A8F6A93C7F76584540B71E76585593AD878F26BD8AE1361CCB0462F2A0023D22BCAA903A4D")
  inputPoint* = hexToByteArray[32]("AD5570F5A3810B7AF9D4B24BC1C2EA670245DB2EAA49AAE654B8F7393A9A6214")
  claimedValue* = hexToByteArray[32]("17F10B3E7BFC7894E4150626380E226D7B1D0085550067787F259A7F55BB5D36")
  nblobs* = 5
  trustedSetup* = staticRead(trustedSetupFile)

when (NimMajor, NimMinor) > (1, 4):
  import std/sysrand
  export sysrand.urandom
else:
  import std/random

  proc urandom*(x: var openArray[byte]): bool =
    randomize()
    for i in 0 ..< x.len:
      x[i] = byte.rand()
    true
